import React from "react";

function ContactSection() {
  return (
    <section id="contact" className="section contact">
      <h2>Contact Me</h2>
      <p>Email: charvi.isu24@gmail.com</p>
      <p>Phone: +1 309-340-1831</p>
      <p>
        LinkedIn:{" "}
        <a href="https://www.linkedin.com/in/charvibasappa/">
          linkedin.com/in/charvibasappa
        </a>
      </p>
      <p>
        GitHub:{" "}
        <a href="https://github.com/CharviBasappa">github.com/CharviBasappa</a>
      </p>
    </section>
  );
}

export default ContactSection;
